my @options = (
    'backend-collect-timeout=i',
    'ca-cert-file=s',
    'clean',
    'color',
    'cron=i',
    'debug|d=i',
    'distro=s',
    'no-question|Q',
    'extract=s',
    'force',
    'help|h',
    'install',
    'list',
    'local|l=s',
    'logger=s',
    'logfacility=s',
    'logfile=s',
    'no-httpd',
    'no-ssl-check',
    'no-compression|C',
    'no-task=s',
    'no-p2p',
    'httpd-ip=s',
    'httpd-port=s',
    'httpd-trust=s',
    'reinstall',
    'runnow',
    'scan-homedirs',
    'scan-profiles',
    'server|s=s',
    'service=i',
    'silent|S',
    'skip=s',
    'snap',
    'tag|t=s',
    'tasks=s',
    'type=s',
    'uninstall',
    'unpack',
    'verbose|v',
    'version',
);

my %options;
foreach my $opt (@options) {
    my ($plus)   = $opt =~ s/\+$//;
    my ($string) = $opt =~ s/=s$//;
    my ($int)    = $opt =~ s/=i$//;
    my ($long, $short) = $opt =~ /^([^|]+)[|]?(.)?$/;
    $options{"--$long"} = [ $plus, $string, $int, $long ];
    $options{"-$short"} = $options{"--$long"} if $short;
}

sub GetOptions {

    my $options = {};

    my ($plus, $string, $int, $long);

    while (@ARGV) {
        my $argv = shift @ARGV;
        if ($argv =~ /^(-[^=]*)=?(.+)?$/) {
            my $opt = $options{$1}
                or return;
            ( $plus, $string, $int, $long) = @{$opt};
            if ($plus) {
                $options->{$long}++;
                undef $long;
            } elsif (defined($2) && $int) {
                $options->{$long} = int($2);
                undef $long;
            } elsif ($string) {
                $options->{$long} = $2;
            } else {
                $options->{$long} = 1;
                undef $long;
            }
        } elsif ($long) {
            if ($int) {
                $options->{$long} = int($argv);
                undef $long;
            } elsif ($string) {
                $options->{$long} .= " " if $options->{$long};
                $options->{$long} .= $argv;
            }
        } else {
            return;
        }
    }

    return $options;
}

